import Vue from 'vue'
import VueRouter from 'vue-router'
import Home from "@/views/Home"
import Login from "@/views/Login"
import Goods from "@/views/warehouse/Goods"
import InOrder from "@/views/warehouse/InOrder"

Vue.use(VueRouter)

const routes = [
    {
        path: '/home',
        name: 'home',
        component: Home,
        children: [
            {
                path: '/warehouse/goods',
                name: 'goods',
                component: Goods  // 商品管理
            },
            {
                path: '/warehouse/inOrder',
                name: 'inOrder',
                component: InOrder  // 入库订单管理
            },
            {
                path: '/'
            }
        ]
    },
    {
        path: '/',
        name: 'login',
        component: Login
    }
]

const router = new VueRouter({
    routes
})

export default router
